import React from 'react';
import ReactDOM from 'react-dom';
const rootToRender = document.getElementById('ReactDOM');
ReactDOM.render(
<ul>
	<li>Babi</li>
	<li>Anjing</li>
	<li>Kucing</li>
</ul>
,rootToRender);
